('1','https://media.discordapp.net/attachments/709858319568732292/1332539423560175749/IMG_8486.jpg?ex=67959f8b&is=67944e0b&hm=2d4be33421680d61579ba6896a01f383689dd3323f8395069d8b23775f63b296&=&format=webp&width=550&height=733','I am a motivated and creative young computer programmer who has high goals to drive technological progress. I am passionate about developing innovative solutions that solve real-world problems through technology. I am known for my attention to detail, strong communication skills and being a collaborative team player. I always strive to complete tasks with precision, and I am eager to contribute to new interesting projects that push the technological boundaries.','English, French, Bulgarian');
